# gradient descent
def grad_des(x):
    i = 0
    max_It = 10000
    x = np.array(x)
    xnow = 0 * x
    gradnow = 0 * x
    norm =1
    while (i < max_It and norm > 5*10**(-15)):
        grad = np.array(gradient(x))
        norm =np.linalg.norm(list(grad))
        print(norm)
        xprev = xnow
        xnow = x
        s = xnow - xprev
        gradprev = gradnow
        gradnow = grad
        g = gradnow - gradprev
        alpha1 =  s.dot(g) / np.linalg.norm(g)**2
        #alpha2 =  np.linalg.norm(s)**2 / s.dot(g)
        #print(x)
        #print(alpha1)
        #if i > 100: alpha1 = .5 * (alpha1 + alpha2)

        x = x - alpha1 * grad
        i += 1
    print(np.linalg.norm(gradient(x)))
    return x

